import React,{Component} from 'react';
var restoidurl="http://localhost:8700/restaurantdetail?_id=";
class order extends Component



{
    constructor(){

        super();
        this.state={
          "Order_id":Math.floor(Math.random()*100000),
            "name":"",
            "phone":"" ,
            restoname:''
        }
    }
    render(){
        return(
            <div className="container">
                <div className="panel panel-success">

                    <div className="panel-heading">
                      <h3>Place Order</h3>
                    </div>
                    <div className="panel-body">
                        <div className="form-group">
                            <label>Order Id:</label>
<input type="text" className="form-control" value={this.state.Order_id} readOnly/>
                        </div>

                        <div className="form-group">
                            <label>Resto Name:</label>
<input type="text" className="form-control" value={restoname.name} readOnly/>
                        </div>

                            

                    </div>
                </div>
            </div>
        )
    }

    componentDidMount()
    {
        
       // fetch(locurl,{method:'GET'})
       // .then((res)=> res.json)
       // .then((data)=>{
            console.log("hello")
           // console.log(data);
      //  })
     
      fetch(`${restoidurl}${this.props.match.params.id}`)
      .then((response)=>{
       response.json()
      .then((data) => {
        console.log(data);
   this.setState({restoname:data});
      
    });
});
    }
}
export default order;
